description:
320kbps recording of the first part of the Led Zeppelin concert in Los Angeles on September 4th, 1970.
This bootleg is famously known as &quot;Live On Blueberry Hill&quot;, named after the cover song Zeppelin performed as the last song of the show.
(I have Part 2 in another torrent: http://thepiratebay.se/torrent/5604982)
I did not source this; however, I did reorganize/relabel/reseed.


Artist: &quot;Led Zeppelin&quot;
Album: &quot;1970.09.04 - Los Angeles (Live On Blueberry Hill) [Disc 1]&quot;
Date: &quot;1970&quot;
Genre: &quot;Rock&quot;

(That date system ensures that it will sort chronologically with other live recordings that are labeled in a similar manner.)
